import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './AddUser.css';
import pageLogo from '../assets/logo.png';
import logoutIcon from '../assets/cerrar.png';

const AddUser = () => {
    const navigate = useNavigate();
    const [formData, setFormData] = useState({
        username: '',
        password: '',
        nombre: '',
        apellidos: '',
        genero: '',
        fechaNacimiento: '',
        email: '',
        tipoUsuario: '',
        departamento: ''
    });

    const handleBack = () => {
        navigate('/users');
    };

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await fetch('/api/users', {  // Ajusta la URL según tu API
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(formData),
            });

            if (response.ok) {
                console.log('Usuario registrado');
                navigate('/users');  // Redirige a la gestión de usuarios después del registro
            } else {
                console.error('Error al registrar usuario');
            }
        } catch (error) {
            console.error('Error de red:', error);
        }
    };

    return (
        <div className="main-container">
            <nav className="navbar">
                <div className="logo">
                    <img src={pageLogo} alt="Page Logo" />
                    <span>Expedium</span>
                </div>
                <ul className="nav-links">
                    <li>Usuarios</li>
                    <li>Expedientes</li>
                    <li>Documentos</li>
                    <li>Perfil</li>
                </ul>
                <div className="logout-icon">
                    <img src={logoutIcon} alt="Logout" />
                </div>
            </nav>
            <div className="add-user-content">
                <form className="add-user-form" onSubmit={handleSubmit}>
                    <h2>Registrar Usuario</h2>
                    <input type="text" name="username" placeholder="Username" required value={formData.username} onChange={handleChange} />
                    <input type="password" name="password" placeholder="Password" required value={formData.password} onChange={handleChange} />
                    <input type="text" name="nombre" placeholder="Nombre" required value={formData.nombre} onChange={handleChange} />
                    <input type="text" name="apellidos" placeholder="Apellidos (opcional)" value={formData.apellidos} onChange={handleChange} />
                    <select name="genero" value={formData.genero} onChange={handleChange}>
                        <option value="">Género (opcional)</option>
                        <option value="male">Masculino</option>
                        <option value="female">Femenino</option>
                        <option value="other">Otro</option>
                    </select>
                    <input type="date" name="fechaNacimiento" placeholder="Fecha de nacimiento (opcional)" value={formData.fechaNacimiento} onChange={handleChange} />
                    <input type="email" name="email" placeholder="Email" required value={formData.email} onChange={handleChange} />
                    <input type="text" name="tipoUsuario" placeholder="Tipo de usuario" required value={formData.tipoUsuario} onChange={handleChange} />
                    <input type="text" name="departamento" placeholder="Departamento (opcional)" value={formData.departamento} onChange={handleChange} />
                    <div className="form-buttons">
                        <button type="submit" className="register-btn">Registrar</button>
                        <button type="button" className="back-btn" onClick={handleBack}>Regresar</button>
                    </div>
                </form>
            </div>
        </div>
    );
}

export default AddUser;
